const inputDate = new Date($input.first().json.currentDate);

// Current timestamp in seconds
const toTimestamp = Math.floor(inputDate.getTime() / 1000);
const fromTimestamp = toTimestamp - 7200;

// Convert to human-readable IST
const toTimeIST = new Date(toTimestamp * 1000).toLocaleString('en-IN', { timeZone: 'Asia/Kolkata' });
const fromTimeIST = new Date(fromTimestamp * 1000).toLocaleString('en-IN', { timeZone: 'Asia/Kolkata' });

// Get all items from "Form Strike Price" node
const strikePriceItems = $items("Form Strike Price");

return strikePriceItems.map(item => {
    return {
        json: {
            ...item.json,
            from: fromTimestamp,
            to: toTimestamp,
            fromTimeIST,
            toTimeIST
        }
    };
});

const spot = $input.first().json.result.spot_price // e.g., 108422
const step = 20;

// Calculate strikes
const lowerStrike = Math.floor(spot / step) * step;
const upperStrike = Math.ceil(spot / step) * step;

// Fetch all data from the "Time Slot" node
const timeSlotData = $items("Time is 5:30 AM?");

return timeSlotData.map(item => {
  return {
    json: {
      ...item.json,
      lowerStrike,
      upperStrike
    }
  };
});

const inputItems = $input.all();

const results = [];

for (const item of inputItems) {
  const expiry = item.json.expiry;
  const type = item.json.type;
  const lowerStrike = item.json.lowerStrike;
  const upperStrike = item.json.upperStrike;

  results.push(
    {
      json: {
        ...item.json,
        symbol: `C-ETH-${upperStrike}-${expiry}`,
        label: 'call-upper',
        type
      }
    },
    {
      json: {
        ...item.json,
        symbol: `P-ETH-${upperStrike}-${expiry}`,
        label: 'put-upper',
        type
      }
    },
    {
      json: {
        ...item.json,
        symbol: `C-ETH-${lowerStrike}-${expiry}`,
        label: 'call-lower',
        type
      }
    },
    {
      json: {
        ...item.json,
        symbol: `P-ETH-${lowerStrike}-${expiry}`,
        label: 'put-lower',
        type
      }
    }
  );
}

return results;

let lastExpiry = null;
let counter = 0;

return items.map(item => {
  const expiry = item.json["Expiry Date"];

  if (expiry !== lastExpiry) {
    counter = 1;
    lastExpiry = expiry;
  } else {
    counter++;
  }

  // Create Unique ID
  item.json["Unique ID"] = `${item.json["Entry Date"]}_${item.json["Expiry Date"]}_${item.json["Strike Price"]}_${counter}`;

  // Remove temp customIndex if exists
  delete item.json.customIndex;

  return item;
});

